import React, { Component } from "react";

class AgentEdit extends Component {
  state = {
    t: this.props.location.state
  };
  Agent = props => {
    this.setState({
      t: this.props.location.state
    });
    console.log(this.t);
  };
  componentDidMount() {
    this.Agent();
  }
  render() {
    return (
      <div>
        <p>{this.state.t}</p>
      </div>
    );
  }
}

export default AgentEdit;
